let randomDepthMin,
    randomDepthMax,
    randomRemovalDepthMin,
    randomRemovalDepthMax;

class Main {
    constructor(
        size=1000,
        depth=1,
        seed,
        useColors,
        useRandomVertices,
        _randomDepthMin=0,
        _randomDepthMax=100,
        _randomRemovalDepthMin,
        _randomRemovalDepthMax
    ) {

        console.log(`using seed: ${seed}`);
        this.useColors = useColors;

        this.useRandomVertices = useRandomVertices;
        this.random = new SeededRandom(seed);
        this.random.random();
        this.size = size;
        this.depth = depth;
        this.shapesByDepth = {};
        this.pallette = this.randomPallette;

        randomDepthMin = _randomDepthMin;
        randomDepthMax = _randomDepthMax;
        randomRemovalDepthMin = _randomRemovalDepthMin;
        randomRemovalDepthMax = _randomRemovalDepthMax;
    }

    createCanvas() {

        let drawArea = document.getElementById('draw-area');
        let oldCanvas = drawArea.getElementsByTagName('canvas');

        let canvas = document.createElement('canvas');

        for (let i = 0; i < oldCanvas.length; i++) {
            let el = oldCanvas[i];
            drawArea.removeChild(el);
        }

        drawArea.appendChild(canvas);
        canvas.height = canvas.width = this.size;
        this.context = canvas.getContext('2d');
    }

    get randomPallette() {
        return presetColors[Math.floor(this.random.lastRandomValue * presetColors.length)];
    }

    get randomColor() {
        return this.pallette[Math.floor(this.random.random() * this.pallette.length)];
    }

    generate() {
        let currentDepth = 0;
        this.square = new Square(0, 0, this.size, currentDepth, null, this.random, this.useRandomVertices);
        this.shapesByDepth[currentDepth] = [this.square];

        while(currentDepth !== this.depth) {
            let nextDepth = currentDepth+1;
            if(!this.shapesByDepth[nextDepth]) {
                this.shapesByDepth[nextDepth] = [];
            }

            this.shapesByDepth[currentDepth].forEach((square)=> {
                currentDepth = square.breakUp();
                this.shapesByDepth[nextDepth] = this.shapesByDepth[nextDepth].concat(square.polygons);
            });



            currentDepth = nextDepth;
        }
    }

    start() {
        setInterval(()=> this.draw(), 1000/2)
    }

    draw() {
        if(!this.context) {
            this.createCanvas();
        }

        this.context.fillStyle = '#ece2c5';
        this.context.fillRect(0, 0, this.size, this.size);
        this.context.strokeStyle = '#282828';
        this.context.lineWidth = 0.7;

        this.square.polygons.forEach((poly)=>this.drawParent(poly));
    }

    drawParent(parent) {
        this.drawPolygon(parent);
        if((parent.depth >= randomRemovalDepthMin && parent.depth <= randomRemovalDepthMax) &&
            (parent.polygons.length > 0 && (parent.depth >= 11 && this.random.random() > .5) || (parent.depth <= 10 && this.random.random() > .1))) {
            parent.polygons.forEach((poly) => {
                this.drawParent(poly);
            })
        }
    }

    drawPolygon(polygon) {
        let ctx = this.context;

        if(!polygon.color) {
            polygon.color = this.randomColor;
        }

        if(this.useColors) {
            this.context.fillStyle = this.context.strokeStyle = polygon.color;
        }

        ctx.beginPath();
        ctx.moveTo(polygon.points[0].x, polygon.points[0].y);
        ctx.lineTo(polygon.points[1].x, polygon.points[1].y);
        ctx.lineTo(polygon.points[2].x, polygon.points[2].y);
        ctx.closePath();
        ctx.stroke();
        ctx.fill();
    }
}

class Square {
    constructor(x, y, size, depth, parent, random, useRandomVertices) {
        this.useRandomVertices = useRandomVertices;
        this.random = random;
        this.x = x;
        this.y = y;
        this.size = size;
        this.depth = depth;
        this.parent = parent;
        this.children = [];
        this.polygons = [];
    }

    breakUp() {
        let halfSize = this.size/2;
        let topLeft = new Point(this.x, this.y),
            topRight = new Point(this.x + this.size, this.y),
            bottomLeft = new Point(this.x, this.y + this.size),
            bottomRight = new Point(this.x + this.size, this.y + this.size),
            middle = new Point(this.x + halfSize, this.y + halfSize);


        this.polygons.push(new Triangle([topLeft, bottomLeft, middle], this, this.depth + 1, this.random, this.useRandomVertices));
        this.polygons.push(new Triangle([topLeft, topRight, middle], this, this.depth + 1, this.random, this.useRandomVertices));
        this.polygons.push(new Triangle([topRight, bottomRight, middle], this, this.depth + 1, this.random, this.useRandomVertices));
        this.polygons.push(new Triangle([bottomRight, bottomLeft, middle], this, this.depth + 1, this.random, this.useRandomVertices));
    }
}

class Triangle {
    constructor(points, parent, depth, random, useRandomVertices) {
        this.useRandomVertices = useRandomVertices;
        this.random = random;
        this.parent = parent;
        this.depth = depth;
        this.points = points;
        this.polygons = [];
    }

    get r () {
        let values = [.35, .4, .45, .5, .55];

        return this.random.lastRandomValue; //values[Math.floor(this.random.lastRandomValue * values.length)];
    }

    breakUp() {
        let median,
            ps = this.points;

        if(this.useRandomVertices && ((randomDepthMin + randomDepthMax) === 0 || (this.depth >= randomDepthMin && this.depth <= randomDepthMax))) {
            median = new Point(((ps[0].x - ps[1].x) * this.r) + ps[1].x, ((ps[0].y - ps[1].y) * this.r) + ps[1].y);
        } else {
            median = new Point(Math.ceil((ps[0].x + ps[1].x) / 2), Math.ceil((ps[0].y + ps[1].y) / 2));
        }

        this.polygons.push(new Triangle([ps[2], ps[1], median], this.parent, this.depth + 1, this.random, this.useRandomVertices));
        this.polygons.push(new Triangle([ps[2], ps[0], median], this.parent, this.depth + 1, this.random, this.useRandomVertices));



    }
}

class Point {
    constructor(x, y) {
        this.x = x;
        this.y = y;
    }
}

class SeededRandom {
    constructor(seed) {
        this.initialSeed = seed;
        this.seed = seed * 1000;
    }

    random() {
        let x = Math.sin(this.seed++) * 10000;
        this.lastRandomValue = x - Math.floor(x);
        return this.lastRandomValue;
    }

    guid() {
        return this.s4() +
            this.s4() + '-' +
            this.s4() + '-' +
            this.s4() + '-' +
            this.s4() + '-' +
            this.s4() +
            this.s4() +
            this.s4();
    }

    s4() {
        return Math.floor((1 + this.random()) * 0x10000)
            .toString(16)
            .substring(1);
    }
};

